import React from 'react'
import logo from "../../logo.png"
import { Link } from 'react-router-dom'

export default function Header() {
  return (
   <nav className='header'>

    <img src={logo} alt="logo" />
    <div>
        <Link to="/">Home</Link>
    </div>

   </nav>
  )
}
